import React from "react";
import { ClieFormContainer, ClienteContainer } from "./Cliente.Style";

export const Cliente = () => {
  return (
    <ClienteContainer>
      <ClieFormContainer>
        <div className="title">Cadastro de Cliente</div>

        <div className="input-container">
          <div className="bloco-direita"></div>
          <div className="bloco-esquerda"></div>
        </div>
        
      </ClieFormContainer>
    </ClienteContainer>
  );
};
